package main.com;import java.io.IOException;import javax.servlet.http.HttpServlet;import javax.servlet.http.HttpServletRequest;import javax.servlet.http.HttpServletResponse;import javax.servlet.ServletException;public class servlet extends HttpServlet {    public static final long SerialVersionUID = 1L;    @Override    protected void doGet(HttpServletRequest req, HttpServletResponse res)            throws ServletException,IOException{        String name = req.getParameter("name");        String age = req.getParameter("age");        System.out.println("name: " + name);        System.out.println("age: " + age);    }}